import React, { Component } from "react";
import { connect } from "react-redux";
import { addVehicle } from "../Redux/Action";

class ViewAllVehicles extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    const { data } = this.props;
    console.log(data);

    return (
      <table>
        <tbody>
          {data.map(vehicle => {
            return (
              <tr key={vehicle.id}>
                <td>{vehicle.model_name}</td>
                <td>{vehicle.top_speed}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    );
  }
}

const mapStateToProps = state => {
  return {
    data: state.data
  };
};
const mapDispatchToProps = dispatch => {
  return {
    addVehicle: vehicle => dispatch(addVehicle(vehicle))
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(ViewAllVehicles);
